import './App.css';
import { Outlet } from "react-router-dom";
import 'animate.css';

import React from 'react';
import LanguageSelector from './Lang/LanguageSelector';
import MyComponent from './MyComponent';
import { LanguageProvider } from './Lang/useLanguage';

const App = () => {
  return (
    <LanguageProvider>
      <div>
        <LanguageSelector />
        <MyComponent />

        <Outlet />
      </div>
    </LanguageProvider>
  );
};

export default App;
